1.6. KYC/AML checks​. In connection with KYC/AML checks, all Swap.Online Token Purchasers will be required to provide supplemental information and documentation:
● copy of a legal entity identification document, indicating the company name, legal form, registry code and registered address;
● area of activity;
● address of the place of business;
● first and last name, personal identification code, time and place of birth, address of residence and profession of the company representative;
● name, number, date of issue, and name of the issuer of a identity document of the company representative;

● basis for the right of representation; a document, certifying the right of representation.
● details of the actual beneficiary;
● information whether a representative is a politically exposed person;
● website address;
● contact phone number and email address.
```

